import React, {useState} from 'react';
import './NavBar.css'

function NavBar() {
  const [hamburgerIsOpen, sethamburgerIsOpen] = useState(true);

  const onHamburgerChange = () => {
    hamburgerIsOpen ? sethamburgerIsOpen(true): sethamburgerIsOpen(false);
  };

  return(
    <div className='navbar'>
      <ul className='menu'>
        <li className='hamburger'>
          <div className='list-icon' onClick={onHamburgerChange}>
            <div class="bar1"></div>
            <div class="bar2"></div>
            <div class="bar3"></div>
          </div>
          <div className={`hamburger-list ${!hamburgerIsOpen ? 'hamburger-closed' : 'hamburger-opened'}`}></div>
        </li>
      </ul>
    </div>
  )
}

export default NavBar;
